  true,\n\t\"url\": null,\n\t\"notes\": \"The Advanced Research Projects Agency-Energy
  (ARPA-E) advances high-potential, high-impact energy technologies that are too early
  for private-sector investment. ARPA-E awardees are unique because they are developing
  entirely new ways to generate, store, and use energy.  ARPA-E projects have the
  potential to radically improve U.S. economic prosperity, national security, and
  environmental well being. We focus on transformational energy projects that can
  be meaningfully advanced with a small investment over a defined period of time.
  Our streamlined awards process enables us to act quickly and catalyze cutting-edge
  areas of energy research.  ARPA-E empowers America's energy researchers with funding,
  technical assistance, and market readiness. Our rigorous program design, competitive
  project selection process, and active program management ensure thoughtful expenditures.
  ARPA-E Program Directors serve for limited terms to ensure a constant infusion of
  fresh thinking and new perspectives.\",\n\t\"license_title\": \"Creative Commons
